import React from 'react';
import ReactDOM from 'react-dom';

//<Lister items={[1,2,3]} />

function Lister(props) {
    const items = props.items;
    const listItems = items.map((number) =>
        <li>{number}</li>
    );

    return (
        <ul>{listItems}</ul>
    );
}

export default Lister;

